import React from 'react';
import ReactDOM from 'react-dom';
import  {add,sub, mult,div} from './App';


ReactDOM.render(
    <>
    <ul>
        <li>
         The sum of two no. is{add(30, 4)}
        </li>
        <li>
         The sub of two no. is{Sub(20,4)}
        </li>
        <li>
         The mult of two no. is{Mult(4,8)}
        </li>
        <li>
         The div of two no. is {Div(7,21)}
        </li>
    </ul>
    </>
    ,
    document.getElementById('root')
)
